scanner.register("ReleaseNote File Name:", function(lineNumber, line) {
     var ReleaseNoteFilePath=line.replace("ReleaseNote File Name:","");
     properties.put("ReleaseNote",ReleaseNoteFilePath);
});



scanner.scan();

var exit = properties.get('exitCode');

if (exit == 0) {
    properties.put('Status', 'Success');
}
else {
     properties.put('Status', 'Failure');
}

